import React, { useState } from 'react';
import { Link } from 'react-router-dom'; // Import Link
import './homepage.css'
import Barbershop_pic from '../Assets/Barbershop.jpg';

export const HomePage = () => {
  const [action, setAction] = useState("Sign Up");

  return (
    <div>
      <div className="navbar">
        <div className="left">JSM's Chop Shop</div>
        <div className="right">
          {/* Use Link to navigate to "/LoginSignUp" */}
          <Link to="/LoginSignUp"><button>Sign Up</button></Link>
          <Link to="/LoginSignUp"><button>Login</button></Link>
        </div>
      </div>
      <div className="main-content">
        <h2>Welcome to JSM's Chop Shop</h2>
        <img src={Barbershop_pic} alt="Chop Shop Image" />
        <p>Book your appointment now and get the perfect style!</p>
        <Link to="/ScheduleAppt"><button className='book-now'>Book Now</button></Link>
      </div>
      <div className="footer">
        <p>&copy; 2024 JSM's Chop Shop. All rights reserved.</p>
      </div>
    </div>
  );
};
